import react, { useState } from "react";
import {Link} from "react-router-dom";
import styled from "styled-components";
import {BsFillChatLeftTextFill} from "react-icons/bs";

const Backup = () => {
    const handleChangeSelection = (value) => {
        console.log(value);
        window.location.href = String("/" + value);
    };
    const StyledLink = styled(Link)`
    display: inline-block;
    position: relative;
    margin: 20px;
    color:black;
    font-size: 30px;
    text-decoration: none;
    font-family: "Times New Roman", Times, serif;
    &:hover{
        color:cornflowerblue;
    }
    `;
    return(
        <div>
            <div>
                    <StyledLink to="/home" className="navbar-brand navbar-item"><h1 className="h1">homepage</h1></StyledLink>
                </div>
                <div className="">
                    <StyledLink to="/signin" className="navbar-brand navbar-item"><h1 className="h1">Sign in</h1></StyledLink>
                </div>
                <div className="">
                    <select className=" navbar-brand navbar-item dropdown" onChange={event => handleChangeSelection(event.target.value)}>
                        <option className="options" value="">Select</option>
                        <option className="options" value="signin">Sign in</option>
                        <option className="options" value="home">Home</option>
                        <option className="options" value="reeses">Reeses</option>
                    </select>
            </div>
        </div>
    )
}

const Navbar = () => {
    const handleChangeSelection = (value) => {
        console.log(value);
        window.location.href = String("/" + value);
    };
    const StyledLink = styled(Link)`
    display: inline-block;
    position: relative;
    margin: 20px;
    color:black;
    font-size: 30px;
    text-decoration: none;
    font-family: "Times New Roman", Times, serif;
    &:hover{
        color:cornflowerblue;
    }
    `;
    const [show, setShow] = useState(false)
    const handleClick = (e)=> {
        e.preventDefault();
        console.log("true")
        setShow(true)
    }
    return (
        <div>
            {
                show ? (
                    <div  className="navbar nav1 navparent">
                        <div>LOGO</div>
                        <div className="hamburger"><button className="hamburgerbtn" onClick={handleClick}><BsFillChatLeftTextFill></BsFillChatLeftTextFill></button></div>
                    </div>
                ):
                (
                    <div  className="navbar nav1 navparent">
                        <div>LOGO</div>
                        <div className="hamburger"><button className="hamburgerbtn" onClick={handleClick}><BsFillChatLeftTextFill></BsFillChatLeftTextFill></button></div>
                    </div>
                )
            }
        </div>
    )
}

export default Navbar;
